
public class SwitchCaseDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String s="Sachin";
		
		switch(s){
		
		case "Sachin1":
			System.out.println("grand entry");
			
		case "Sachine":
			System.out.println("grand entry");
			break;
			
		case "Sachin11":
			System.out.println("grand entry");
			
			default:
				System.out.println("Normal Entry");
		}
	}

}
